subjectkey:
  type: GUID
  required: true
  description: The NDAR Global Unique Identifier (GUID) for research subject
  range:
  - NDAR*
  alias: guid_id

src_subject_id:
  type: String
  length: 20
  required: true
  description: Subject ID how it's defined in lab/project
  alias: hcpa_id,record_id,subject

interview_date:
  type: Date
  required: true
  description: Date on which the interview/genetic test/sampling/imaging/biospecimen
    was completed. MM/DD/YYYY
  alias: nihtbx_picvocab_date,tcb_date

interview_age:
  type: Integer
  required: true
  description: Age in months at the time of the interview/test/sampling/imaging.
  range:
  - 0::1260
  notes: Age is rounded to chronological month. If the research participant is 15-days-old
    at time of interview, the appropriate value would be 0 months. If the participant
    is 16-days-old, the value would be 1 month.

sex:
  type: String
  length: 20
  required: true
  description: Sex of subject at birth
  range:
  - M
  - F
  - O
  - NR
  notes: M = Male; F = Female; O=Other; NR = Not reported
  alias: dem_gender,gender
  codes:
    M: Male
    F: Female
    O: Other
    NR: Not reported

tbx_vocab_theta:
  type: Float
  description: TPVT theta score
  alias: engvocabtheta,nihtbx_demo_rescore_thetaengvocab,nihtbx_picvocab_theta,spanvocabtheta,tbx_reading_form,tcb_vocb_theta,theta

tbx_vocab_se:
  type: Float
  description: TPVT standard error
  alias: engvocabse,nihtbx_picvocab_se,se,spanvocabse,tcb_vocb_se

tpvt_acss:
  type: Integer
  description: TPVT age-corrected standard score
  alias: age_corrected_standard_score,nihtbx_demo_rescore_agecorrengvocab,nihtbx_picvocab_agecorrected,pvtagecorrscore,tcb_vocb_age_ss

tpvt_uss:
  type: Integer
  description: TPVT uncorrected standard score
  alias: nihtbx_demo_rescore_uncorrengvocab,nihtbx_picvocab_uncorrected,pvtuncscore,tcb_vocb_uncorscr,uncorrected_standard_score

tpvt_fcts:
  type: Integer
  description: TPVT fully corrected T-score
  alias: nihtbx_demo_rescore_fulltengvocab,nihtbx_picvocab_fc,nihtbx_picvocab_fullycorrected,pvttscore,tcb_vocb_full_tscr

tpvt_perc:
  type: Float
  description: TPVT percentile
  alias: national_percentile__age_adjusted_,nihtbx_picvocab_percentile

